import React, { Component } from "react";
import { VictoryLine, VictoryChart } from "victory";
import compHistory from './functions/compHistory';

export default class Tacos extends Component {
  constructor() {
    super();
    // let chart = compHistory("AAPL",2)
    this.state = {
        data: [
          { x: "Sunday", y: 3 },
          { x: "Monday", y: 2 },
          { x: "Tuesday", y: 0 },
          { x: "Wednesday", y: 8 },
          { x: "Thursday", y: 4 },
          { x: "Friday", y: 2 },
          { x: "Saturday", y: 4 },
          { x: "Sunday", y: 6 }
        ]
      };
    }
  render() {
    return (
      <div>
        <h1>Tacos per Day</h1>
        <VictoryChart>
          <VictoryLine
            data={this.state.data}
            style={{
              data: {
                stroke: "#02B875"
              }
            }}
          />
        </VictoryChart>
      </div>
    );
  }
}
